    pileExc1 = 0
    for i in arr:
        if i == 1:
            cnt1 += 1
        else:
            if i == 2:
                cnt2 += 1
            tot += i
            pileExc1 += 1
            if i % 2 != 0:
                oddPilescnt += 1
    if cnt1 == 1:
        if oddPilescnt % 2 == 0:
            return m
        if cnt2 == 0:
            return f
        tot -= 2
