        if (tot - pileExc1) % 2 != 0:
            return f
        else:
            return m
    elif cnt1 > 1:
        if (tot - pileExc1) % 2 != 0:
            return m
        else:
            return f
    elif oddPilescnt % 2 != 0:
        return m
    else:
        return f
